class Table(QtWidgets.QTableWidget):
        def __init__(self,parent):
           super().__init__(parent)
           self.viewport().installEventFilter(self)
           self.setContextMenuPolicy(QtCore.Qt.CustomContextMenu)   
           self.menu = QtWidgets.QMenu()
           self.copy =  self.menu.addAction('&Copy')
           self.deleteAction = self.menu.addAction('&Delete')
           self.deleteAction.setShortcut(Qt.Key_Delete)
           self.copy.setShortcut(QtCore.Qt.CTRL + QtCore.Qt.Key_C)
           self.deleteAction.triggered.connect(self.deleteItem)
           self.copy.triggered.connect(self.copyItems)
        def copyItems(self):
                copied_cells = sorted(self.selectedIndexes())
                max_column = copied_cells[-1].column()
                copy_text = ''
                for index in copied_cells:     
                        try:
                                copy_text += self.item(index.row(),index.column()).text()
                                if index.column() == max_column:
                                        copy_text += '\n'
                                else:
                                        copy_text += '\t'
                        except Exception as e:
                                pass
                QApplication.clipboard().setText(copy_text)

        def deleteItem(self):
                for i in self.selectedItems():
                        try:    
                                row = i.row()
                                self.removeRow(row)
                        except Exception as e:
                                pass
        
        def keyPressEvent(self, event: QtGui.QKeyEvent):
                self.tablerow = self.currentIndex().row()
                self.tablecolumn = self.currentIndex().column()
                if event.key()==Qt.Key_Delete:
                        self.deleteItem()
                if (event.key()== Qt.Key_C and (event.modifiers() & Qt.ControlModifier)):
                        self.copyItems()
                if (event.key() == Qt.Key_Left):
                        columnIndex = self.tablecolumn-1
                        if columnIndex>=0:
                                self.setCurrentCell(self.tablerow,columnIndex)
                if (event.key() == Qt.Key_Right):
                        columnIndex = self.tablecolumn+1
                        if columnIndex<self.columnCount():
                                self.setCurrentCell(self.tablerow,columnIndex)
                # tab key - move right
                if (event.key() == Qt.Key_Tab):
                        columnIndex = self.tablecolumn + 1
                        if columnIndex<self.columnCount():
                                self.setCurrentCell(self.tablerow,columnIndex)
                if (event.key() == Qt.Key_Up):
                        rowIndex = self.tablerow-1
                        if rowIndex>=0:
                                self.setCurrentCell(rowIndex,self.tablecolumn)
                if (event.key() == Qt.Key_Down):
                        rowIndex = self.tablerow+1
                        if rowIndex<self.rowCount():
                                self.setCurrentCell(rowIndex,self.tablecolumn)

        def generateMenu(self, pos):
            self.menu.exec_(self.mapToGlobal(pos))  

